import React from "react";
import { ReactFlow, ReactFlowProvider, Handle, Position } from "@xyflow/react";
import "@xyflow/react/dist/style.css";




const nodeTypes = {
  rectangle: ({ data }) => (
    <div style={{ width: 100, height: 50, background: "#D3D3D3", display: "flex", alignItems: "center", justifyContent: "center", borderRadius: 5 }}>
      <Handle type="target" position={Position.Top} />
      {data.label}
      <Handle type="source" position={Position.Bottom} />
    </div>
  ),
  circle: ({ data }) => (
    <div style={{ width: 60, height: 60, background: "#FFD700", borderRadius: "50%", display: "flex", alignItems: "center", justifyContent: "center" }}>
      <Handle type="target" position={Position.Top} />
      {data.label}
      <Handle type="source" position={Position.Bottom} />
    </div>
  ),
  diamond: ({ data }) => (
    <div style={{ width: 100, height: 100, background: "#FF6347", transform: "rotate(45deg)", display: "flex", alignItems: "center", justifyContent: "center" }}>
      <Handle type="target" position={Position.Top} />
      <div style={{ transform: "rotate(-45deg)" }}>{data.label}</div>
      <Handle type="source" position={Position.Bottom} />
    </div>
  ),
};

export const Editor = () => {
  const { Controls, MiniMap, Background, nodes, edges, onNodesChange, onEdgesChange, onConnect } = ReactFlow;
  return (
    <div style={{ height: '100vh', width: '100%' }}>
      <div style={{ position: 'absolute', zIndex: 10, top: 10, left: 10 }}>
        <button style={{ marginRight: 5 }}>Rectangle</button>
        <button style={{ marginRight: 5 }}>Circle</button>
        <button style={{ marginRight: 5 }}>Diamond</button>
        <button style={{ marginRight: 5 }}>Download</button>
      </div>
      <div ref={ReactFlowProvider} style={{ height: '100%', width: '100%' }}>
        <ReactFlow
          nodes={nodes}
          edges={edges}
          onNodesChange={onNodesChange}
          onEdgesChange={onEdgesChange}
          onConnect={onConnect}
          fitView
          nodeTypes={nodeTypes}
        >
          <MiniMap />
          <Controls />
          <Background color="#aaa" gap={16} />
        </ReactFlow>
      </div>
    </div>
  );
};
